  \"2016-04-19T02:27:53.093702\",\n\t\"name\": \"stores-supplying-extra-trash-stickers\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Extra bags of trash that do not fit in
  your trash cart with the lid closed must be placed next to the trash cart and tagged
  with an Extra Trash Sticker, which can be purchased at H-E-B, Randall's and most
  local grocery stores for $4 + tax. Extra bags without a sticker will be charged
  a per-bag fee of $9.60 + tax. If you find that you often set out extra bagged garbage,
  consider switching to a larger cart for $15 (plus applicable monthly cart fee).\",\n\t\"license_title\":
